import './users.css'

const Users = ({userName}) => {
    return (
        <div>
            <div className="user">
                <img className="picture" src="https://images.pexels.com/photos/11341064/pexels-photo-11341064.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" alt="jhalak" />
                <span className="user_name">{userName}</span>
            </div>
        </div>
    )
}

export default Users
